import React from 'react';
import styled from 'styled-components';
import {ReactComponent as BotonAtrasImg } from '../imagenes/botonAtras.png'

import {useNavigate} from 'react-router-dom';

const BotonAtrasStylo = styled.button`
    display: block;
    width: 3.12rem; /* 50px */
    height: 3.12rem; /* 50px */
    line-height: 3.12rem; /* 50px */
    text-align: center;
    margin-right: 1.25rem; /* 20px */
    border: none;
    background: #000;
    color: #fff;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 0.31rem; /* 5px */
    cursor: pointer;

    @media(max-width: 60rem){ /* 950px */
        width: 2.5rem; /* 40px */
        height: 2.5rem; /* 40px */
        line-height: 2.5rem; /* 40px */
    }
`;

const Icono = styled(BotonAtrasImg)`
    width: 50%;
    height: auto;
    fill: #fff;
`;

const BotonAtras = ({ruta = '/'}) => {
	const navigate = useNavigate();

	return (
		<BotonAtrasStylo onClick={() => navigate(ruta)}><img src={Icono} alt="Botón Atrás" /></BotonAtrasStylo>
	);
}

export default BotonAtras;
